import React, { useEffect, useState } from "react";
import api from "../api";
import "./Checkout.css"; // CSS opcional se quiser separar

export default function Checkout() {
  const [items, setItems] = useState([]);
  const [subtotal, setSubtotal] = useState(0);
  const [delivery, setDelivery] = useState(0);
  const [total, setTotal] = useState(0);

  const Cidade = {
    "Jandira-SP": 10,
    "Barueri-SP": 20,
    "Itapevi-SP": 20,
    "Cotia-SP": 20,
  };

  const [form, setForm] = useState({
    name: "",
    phone: "",
    bairro: "",
    cep: "",
    street: "",
    number: "",
    complement: "",
    reference: "",
    paymentMethod: "Dinheiro",
    change: ""
  });

  useEffect(() => {
    load();
  }, []);

  async function load() {
    const sessionId = localStorage.getItem("sessionId");
    if (!sessionId) return;

    try {
      const r = await api.get("/cart/" + sessionId);
      const data = r.data || [];
      setItems(data);

      const st = data.reduce(
        (acc, i) => acc + (i.price || 0) * (i.quantity || 0),
        0
      );

      setSubtotal(st);
      setTotal(st + delivery);
    } catch (err) {
      console.error("Erro ao carregar carrinho", err);
    }
  }

  function calcDelivery(bairro) {
    const price = bairros[bairro] || 0;
    setDelivery(price);
    setTotal(subtotal + price);
  }

  async function submitOrder() {
    const sessionId = localStorage.getItem("sessionId");

    let changeValue = form.change || null;
    if (changeValue !== null) changeValue = Number(changeValue);

    const endereco =
      `${form.street || ""} ${form.number || ""}` +
      (form.complement ? ` - ${form.complement}` : "") +
      (form.bairro ? `, ${form.bairro}` : "") +
      (form.cep ? `, CEP: ${form.cep}` : "") +
      (form.reference ? ` (Ref: ${form.reference})` : "");

    const req = {
      sessionId,
      ...form,
      change: changeValue
    };

    try {
      const r = await api.post("/orders/checkout", req);
      const order = r.data;

      localStorage.removeItem("sessionId");

      let msg =
        `DEEPSURVEY SUPLEMENTOS\n` +
        `------------------------------\n` +
        `Pedido #${order.id}\n\nItens:\n`;

      order.items.forEach((i) => {
        msg += `${i.quantity}x ${i.product.name} - R$ ${Number(i.price)
          .toFixed(2)
          .replace(".", ",")}\n`;
      });

      msg +=
        `\nSubtotal: R$ ${subtotal.toFixed(2).replace(".", ",")}\n` +
        `Entrega: R$ ${delivery.toFixed(2).replace(".", ",")}\n` +
        `Total: R$ ${total.toFixed(2).replace(".", ",")}\n\n` +
        `Endere√ßo:\n${endereco}\n\n` +
        `Pagamento: ${form.paymentMethod}\n` +
        `${changeValue ? "Troco para R$ " + changeValue : ""}\n\n` +
        `www.deepsurveysuplementos.com.br`;

      msg = msg.replace(/‚Äì/g, "-");
      const encoded = encodeURIComponent(msg);
      const phone = "5511947935371";
      window.location.href = `https://api.whatsapp.com/send?phone=${phone}&text=${encoded}`;
    } catch (err) {
      console.error("Erro no checkout:", err);
      alert("Erro ao enviar pedido.");
    }
  }

  function fmt(v) {
    return Number(v || 0).toFixed(2).replace(".", ",");
  }

  return (
    <div className="container" style={{ maxWidth: 1100, paddingTop: 30 }}>
      <h2>Pedido Delivery</h2>

      <div style={{ display: "flex", gap: 40, alignItems: "flex-start" }}>

        {/* FORMUL√ÅRIO */}
        <div style={{ flex: 1 }}>
          <div className="section-title">üßç Dados do cliente</div>

          <input
            className="form-input"
            placeholder="Nome completo"
            onChange={(e) => setForm({ ...form, name: e.target.value })}
          />

          <input
            className="form-input"
            placeholder="Whatsapp"
            onChange={(e) => setForm({ ...form, phone: e.target.value })}
          />

          <div className="section-title" style={{ marginTop: 25 }}>üì¶ Entrega</div>

          <label>Bairro / Regi√£o:</label>
          <select
            className="form-input"
            value={form.bairro}
            onChange={(e) => {
              setForm({ ...form, bairro: e.target.value });
              calcDelivery(e.target.value);
            }}
          >
            <option value="">Selecione...</option>
            {Object.keys(bairros).map((b) => (
              <option key={b} value={b}>{b}</option>
            ))}
          </select>

          <input
            className="form-input"
            placeholder="CEP"
            onChange={(e) => setForm({ ...form, cep: e.target.value })}
          />

          <input
            className="form-input"
            placeholder="Rua"
            onChange={(e) => setForm({ ...form, street: e.target.value })}
          />

          <div style={{ display: "flex", gap: 10 }}>
            <input
              className="form-input"
              placeholder="N√∫mero"
              onChange={(e) => setForm({ ...form, number: e.target.value })}
            />
          </div>

          <input
            className="form-input"
            placeholder="Complemento"
            onChange={(e) => setForm({ ...form, complement: e.target.value })}
          />

          <input
            className="form-input"
            placeholder="Ponto de refer√™ncia"
            onChange={(e) => setForm({ ...form, reference: e.target.value })}
          />

          <div className="section-title" style={{ marginTop: 25 }}>üí≥ Pagamento</div>

          <select
            className="form-input"
            onChange={(e) =>
              setForm({ ...form, paymentMethod: e.target.value })
            }
          >
            <option>Dinheiro</option>
            <option>D√©bito</option>
            <option>Cr√©dito</option>
            <option>Pix</option>
          </select>

          <input
            className="form-input"
            placeholder="Troco (opcional)"
            onChange={(e) => setForm({ ...form, change: e.target.value })}
          />

          <button className="btn-confirm" onClick={submitOrder}>
            Enviar pedido via WhatsApp
          </button>
        </div>

        {/* NOTA FISCAL (PAINEL LATERAL) */}
        <div style={{ width: 330 }}>
          <div className="nota-box">

            <h3 className="nota-title">DEEPSURVEY SUPLEMENTOS</h3>

            <div className="nota-section">
              <div className="row">
                <span>Subtotal:</span>
                <strong>R$ {fmt(subtotal)}</strong>
              </div>

              <div className="row">
                <span>Entrega:</span>
                <strong>{delivery ? `R$ ${fmt(delivery)}` : "‚Äî"}</strong>
              </div>

              <div className="row total">
                <span>Total:</span>
                <strong>R$ {fmt(total)}</strong>
              </div>
            </div>

            <div className="payment-preview">
              {form.paymentMethod}
            </div>

            <div className="site">www.deepsurveysuplementos.com.br</div>
          </div>

          <div style={{ textAlign: "center", color: "#888", marginTop: 12 }}>
            O seu pedido ser√° enviado para o nosso WhatsApp
          </div>
        </div>
      </div>
    </div>
  );
}
